# Complete the isValid function below.
def isValid(s):
	s_dict = dict()
	nums = list()
	num_dict = dict()
	for ch in s:
		if ch in s_dict:
			s_dict[ch] = s_dict[ch] + 1
		else:
			s_dict[ch] = 1

	nums = list(s_dict.values())
	nums_un = list(set(nums))
	boss_dog = 0
	ct = 0
	for n in nums_un:
		ct = nums.count(n)
		if ct>=boss_dog:
			boss_dog = n
	ct = 0
	for n in nums:
		if abs(n-boss_dog)==0:
			continue
		elif abs(n-boss_dog)==1:
			ct = ct + 1
		elif abs(n-boss_dog)>0:
			ct = 2
	if ct ==1 or ct ==0:
		return "YES"
	elif ct == 2:
		if 1 in nums_un:
			if len(nums_un) ==2:
				if nums.count(1)==1:
					return "YES"
				else:
					return "NO"
			else:
				return "NO"
		else:
			return "NO"
	else:
		return "NO"




	
